// src/components/List.js
import React from 'react';

const List = ({ recordings, onSelectRecording }) => {
  if (recordings.length === 0) {
    return <div>No recordings available</div>;
  }

  return (
    <div>
      <h1>Recordings List</h1>
      <ul>
        {recordings.map((recording) => (
          <li key={recording.id}>
            <button onClick={() => onSelectRecording(recording.id)}>
              {recording.title}
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default List;
